	IDSet * getDeviceIDs(uint32_t vendor, uint32_t device, uint32_t subvendor, uint32_t subdevice) {
		IDSet *pci_ids = pci_database;
		for (size_t i = 0; i < sizeof(pci_database) / sizeof(pci_database[0]); ++i, ++pci_ids)
			if (pci_ids->vendor == vendor && pci_ids->device == device && pci_ids->subvendor == subvendor && pci_ids->subdevice == subdevice)
				return pci_ids;
		return nullptr;
	}

	DeviceClass * getDeviceClass(uint32_t baseclass, uint32_t subclass, uint32_t progif) {
		DeviceClass *device_class = pci_device_classes;
		for (size_t i = 0; i < sizeof(pci_device_classes) / sizeof(pci_device_classes[0]); ++i, ++device_class)
			if (device_class->baseclass == baseclass && device_class->subclass == subclass && device_class->progif == progif)
				return device_class;
		return nullptr;
	}
